    playbackData.comments = {"ev-56":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-56","timestamp":1692761228905,"createdByDevGroupId":"devGroupId-0","eventSequenceNumber":56,"permanentRelevance":"never relevant","type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-55","lineNumber":4,"column":26,"pastedEventId":null},"developerGroupId":"devGroupId-1","timestamp":1692761228908,"commentText":"<span style=\"background-color: rgb(59, 76, 98);\">Our first example is done for us! When we create a new Repl with the Haskell template, the default code is the&nbsp;</span><a href=\"http://helloworldcollection.de/\" style=\"background-color: rgb(59, 76, 98);\">canonical example program for any language</a><span style=\"background-color: rgb(59, 76, 98);\">.</span>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null},{"id":"commentId-1","displayCommentEvent":{"id":"ev-56","timestamp":1692761228905,"createdByDevGroupId":"devGroupId-0","eventSequenceNumber":56,"permanentRelevance":"never relevant","type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-55","lineNumber":4,"column":26,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1692761361898,"commentText":"<span style=\"background-color: rgb(59, 76, 98);\">Run the default program and verify it does indeed print, \"Hello, World!\"</span><div><span style=\"background-color: rgb(59, 76, 98);\"><br></span></div><div><div>But how does it work? Let's rebuild this example from scratch.</div></div>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ev-87":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-87","timestamp":1692761238363,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":87,"type":"DELETE","fileId":"fileId-0","character":" ","previousNeighborId":"ev-32","lineNumber":1,"column":1},"developerGroupId":"devGroupId-2","timestamp":1692761559204,"commentText":"<div>This looks a lot like a print statement. Let's try running it and see what happens.<br></div><div><br></div><div>Oh, no, we get an error!</div><div><br></div><div><span style=\"font-family: Courier;\">Parse error: module header, import declaration or top-level declaration expected.</span><br></div><div><br></div><div>Hmm, I remember seeing something that looked like a module header, so let's put that back.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"putStrLn \"Hello, World!\"","startRow":0,"startColumn":0,"endRow":0,"endColumn":24}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"putStrLn \"Hello, World!\"","commentTags":[],"questionCommentData":null}],"ev-156":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-156","timestamp":1692761249847,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":156,"type":"DELETE","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-56","lineNumber":1,"column":18},"developerGroupId":"devGroupId-2","timestamp":1692761767966,"commentText":"Now we have the module header from the original example code. What happens if we run the code now?<div><br></div><div>Now we get an even more instructive error message:</div><div><br></div><div>&nbsp;<span style=\"font-family: Courier;\">The IO action ‘main’ is not defined in module ‘Main’</span><br></div><div><br></div><div>I do remember seeing a definition of 'main' in the example code, so let's try putting that back. (The phrase \"IO action\" refers to the <span style=\"font-style: italic;\">type</span> of <span style=\"font-family: Courier;\">main</span>. We'll talk more about types in the next section.)</div>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ev-203":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-203","timestamp":1692761280306,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":203,"type":"DELETE","fileId":"fileId-0","character":" ","previousNeighborId":"ev-174","lineNumber":3,"column":8},"developerGroupId":"devGroupId-2","timestamp":1692762283011,"commentText":"And now, once again, we have a complete, running program.&nbsp;<div><br></div><div><div>We can already see two key differences between Haskell and imperative programming languages such as Python, Java, and C++:&nbsp;</div><div><br></div><div>1. A Haskell program is not a sequence of statements. Instead, a Haskell program is a collection of <span style=\"font-style: italic;\">declarations </span>that assign names to expressions. Think of these declarations as similar to algebraic equations. As we will see later, these declarations can appear in any order.</div></div><div><br></div><div>2. In Haskell, there is not much distinction between variables and functions. The declaration of <span style=\"font-family: Courier;\">main</span> <span style=\"font-style: italic;\">looks</span> like a variable definition, but <span style=\"font-style: italic;\">behaves</span>&nbsp;like a function definition.</div>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ev-241":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-241","timestamp":1692761305373,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":241,"type":"INSERT","fileId":"fileId-0","character":"!","previousNeighborId":"ev-240","lineNumber":5,"column":29,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1692762433521,"commentText":"You might be wondering, what does <span style=\"font-family: Courier;\">do</span> do? The <span style=\"font-family: Courier;\">do</span> notation allows us to sequence multiple actions, such as&nbsp;<span style=\"font-family: Courier;\">putStrLn</span>.","commentTitle":"","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ev-260":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-260","timestamp":1692762443361,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":260,"type":"DELETE","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-162","lineNumber":1,"column":1},"developerGroupId":"devGroupId-2","timestamp":1692762592844,"commentText":"One last thing: If we do not provide a module header, the Haskell compiler will assume the file it is invoked on is the main module. It will evaluate the declaration of <span style=\"font-family: Courier;\">main</span>&nbsp;and run our program.<div><br></div><div>Unless and until we cover modules in more depth, I will leave the module header out.</div>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}]};
